import React, { Component } from 'react';

class Lunchrooms extends Component {
  render() {
    return (
      <div className="Lunchrooms">
        <div className="container">
            <div className="row">
                <div className="col-md-12">
                  Hello
                </div>
            </div>
        </div>
      </div>
    );
  }
}

export default Lunchrooms;
